import React from 'react';

const HomePage = () => {
  return (
    <div>
      <h2>Home Page</h2>

    </div>
  );
};
<video autoplay muted loop id="videoFondo">
  <source src="tu_video.mp4" type="video/mp4">
  
  Tu navegador no soporta el elemento de video.
  </source>
</video>


export default HomePage;
